import React from 'react';
import { View, Text, StyleSheet } from 'react-native';

// Define the Chats component
const Chats = () => {
  return (
    <View style={styles.section}>
      <Text style={styles.sectionTitle}>Chats</Text>
      <Text>Example chat 1</Text>
      <Text>Example chat 2</Text>
      <Text>Example chat 3</Text>
    </View>
  );
};

// Define the Contacts component
const Contacts = () => {
  return (
    <View style={styles.section}>
      <Text style={styles.sectionTitle}>Contacts</Text>
      <Text>Example contact 1</Text>
      <Text>Example contact 2</Text>
      <Text>Example contact 3</Text>
    </View>
  );
};

// Define the Home component
const Home = () => {
  return (
    <View style={styles.container}>
      <View style={styles.navBar}>
        <Text style={styles.navItem}>Chats</Text>
        <Text style={styles.navItem}>Contacts</Text>
      </View>
      <Chats />
      <Contacts />
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
  },
  navBar: {
    flexDirection: 'row',
    justifyContent: 'space-between',
    paddingVertical: 10,
    paddingHorizontal: 20,
    backgroundColor: '#eee',
  },
  navItem: {
    fontSize: 18,
    fontWeight: 'bold',
  },
  section: {
    padding: 20,
  },
  sectionTitle: {
    fontSize: 20,
    fontWeight: 'bold',
    marginBottom: 10,
  },
});

export default Home;
